import {connect} from "react-redux";
import {Redirect, withRouter} from "react-router-dom"
import {compose} from "redux";
import LaterSeenOrder from "./LaterSeenOrder";


class LaterOrderContainer extends React.Component {


    render() {
        if (!this.props.item.eat.id) {
            view = <Redirect to={"/profile/pizza"}/>
        } else
        return (
            <div>
                <LaterSeenOrder item={this.props.item[this.props.match.params.id]}/>
            </div>
        )
    }
}


let mapStateToprops = (state) => {

    return {
        item: state.laterSeenPage.item,
        fake: state.laterSeenPage.fake,


    }


}

export default compose(
    connect(mapStateToprops, {}),
    withRouter,
)(LaterOrderContainer)
